'use strict';
let SendSingleCommandWithoutResponse = require('./SendSingleCommandWithoutResponse.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
//@@DocBrief("The command for getting all accounts available for the user")
class GetAccountsCommand extends SendSingleCommandWithoutResponse {
    constructor() {
        super();
        this.commandName = "GetAccountsCommand";
    }
    createTransportMessage() {
        return this.messageFactory.createGetAccountsRequestMessage(this.tradingSession, this.requestNumberGenerator, stdlib.nowutc());
    }
}
module.exports = GetAccountsCommand
